"original": |2-
     o  'submission-interrupted': The Job was not completely submitted for
        some unforeseen reason, such as (1) the Printer has crashed before
        the Job was closed by the Client, (2) the Printer or the Document
        transfer method has crashed in some non-recoverable way before the
        Document data was entirely transferred to the Printer, or (3) the
        Client crashed or failed to close the Job before the time-out
        period.  See Section 5.4.31.
"fixed": |-
  -  'submission-interrupted': The Job was not completely submitted for some unforeseen reason, such as (1) the Printer has crashed before the Job was closed by the Client, (2) the Printer or the Document transfer method has crashed in some non-recoverable way before the Document data was entirely transferred to the Printer, or (3) the Client crashed or failed to close the Job before the time-out period.  See Section 5.4.31.
"ko": |-
  - '제출이 중단됨': (1) 클라이언트가 작업을 닫기 전에 프린터가 충돌했거나, (2) 일부 환경에서 프린터 또는 문서 전송 방법이 충돌한 등 예상치 못한 이유로 작업이 완전히 제출되지 않았습니다. 문서 데이터가 프린터로 완전히 전송되기 전에 복구할 수 없는 방식으로 또는 (3) 클라이언트가 충돌했거나 시간 초과 기간 전에 작업을 닫지 못했습니다. 섹션 5.4.31을 참조하십시오.
